      - type: Dynamic
        attributes: {id: tcc1, value: TCC1_PWM24bitPeriodGet}
  - type: String
    attributes: {id: PWM_OUTPUT_DISABLE_API}
    children:
    - type: Values
      children:
      - type: Dynamic
        attributes: {id: tcc1, value: TCC1_PWMPatternSet}
